/*Table structure for table `st_posts` */

DROP TABLE IF EXISTS `st_posts`;

CREATE TABLE `st_posts` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `fecha_hora` datetime DEFAULT current_timestamp(),
  `contenido` varchar(1000) DEFAULT NULL,
